import React, { useEffect, useState } from "react";
import axios from "axios";
import Button from 'react-bootstrap/Button';
import "../../styles/compStyles/welcomeStyle.css";
export default props => {
    const [image,setImage] = useState('');
    useEffect(()=>{
        axios.get(`https://api.nasa.gov/planetary/apod?api_key=DEMO_KEY`)
            .then(res=>{
                setImage()
                console.log(res.data)})
            .catch(err=>console.log(err))
    }, [])
    return (
        <>
            <div className="welcomewrap" style={{}}>
                <div className="welcomelogowrap">
                    <div style={{ "height": "100px", "width": "100px", "border": "3px solid black","background-color":"grey" }}></div>
                </div>
                <div className="welcomebtns">
                    <Button variant="primary" size="md">
                        Get Started
                    </Button>
                    <Button variant="secondary" size="md">
                        Learn More
                    </Button>
                </div>
            </div>
        </>
    )
}
